import { SHOW_ALL } from '../actions/actionTypes';

const OnlineReminderReducer = (state = [], action) => {
	switch (action.type) {
		case SHOW_ALL:
			return [...state, {
				list: action.payload
			}]

		default:
			return state;
	}

}

export default OnlineReminderReducer;
